import classes from "./App.module.css";

function App() {
  return (
    <div className={classes.calculator}>
      <div className={classes.output}>
        <div className={classes.previousOperand}></div>
        <div className={classes.currentOperand}></div>
      </div>
    </div>
  );
}

export default App;
